'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class SendEntryOrderCommand extends SendSingleCommandWithoutResponse {
    entryOrderRequest;
    side;
    clientRate;
    pointSize;
    timeController;
    constructor() {
        super();
        this.commandName = "SendEntryOrderCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createEntryOrderRequestMessage(this.tradingSession, this.entryOrderRequest, this.side, this.clientRate, this.pointSize, this.requestNumberGenerator, stdlib.nowutc(), this.timeController);
    }
}
module.exports = SendEntryOrderCommand
